INSERT INTO `product` VALUES (20,'Aspirin','Acetylsalicylsäure','Bayer Aspirin','GlaxoSmithKline','10 x Tabletes','Fever','50 mg','Peroral','Weekly','M',1,'day',10.5000,12.5000,'Documents/Aspirin_1234567890_Aspirin.pdf','Documents/Aspirin_1234567890_Aspirin.jpg','','1234567890','Aspirin is in a group of drugs called salicylates. It works by reducing substances in the body that cause pain, fever, and inflammation.','application/pdf','28642','image/jpeg','14600','2012-09-22 10:26:57'),(21,'Abilify','Aripiprazole','Abilify Discmelt','AstraZeneca','10 x Tabletes','Antipsychotic','50 mg','Injections','Montly','S',10,'day',20.5000,25.5000,'Documents/Abilify_1234567891_Abilify.pdf','Documents/Abilify_1234567891_Abilify.jpg','','1234567891','Abilify is used to treat the symptoms of psychotic conditions such as schizophrenia and bipolar disorder (manic depression).','','0','image/jpeg','24765','2012-09-22 10:36:54'),(22,'Boniva','Ibandronate','Boniva','Pfizer','100 x Tabletes','Bones','150 mg','Injections','Biweekly','L',7,'day',30.9890,35.5550,'Documents/Boniva_1234567892_Boniva.pdf','Documents/Boniva_1234567892_Boniva.jpg','','1234567892','It alters the cycle of bone formation and breakdown in the body. Ibandronate slows bone loss while increasing bone mass, which may prevent bone fractures.','application/pdf','59704','image/jpeg','9509','2012-09-22 10:43:30'),(23,'Botox','OnabotulinumtoxinA','Botox Cosmetic','Wyeth','10 x Containers','Cosmetic','100 Units','Injections','Montly','L',1,'week',100.5550,100.9990,'Documents/Botox_1234567893_Botox.pdf','Documents/Botox_1234567893_Botox.jpg','','1234567893','Botulinum toxin blocks nerve activity in the muscles, causing a temporary reduction in muscle activity. Botox Cosmetic is used to temporarily lessen the appearance of facial wrinkles.','application/pdf','111949','image/jpeg','13509','2012-09-22 10:49:55'),(24,'Caduet','Amlodipine','Caduet','Amgen','10 x Tabletes','Body','10 mg','Peroral','Biweekly','S',1,'month',50.5550,60.9990,'Documents/Caduet_1234567894_Caduet.pdf','Documents/Caduet_1234567894_Caduet.jpg','','1234567894','It reduces levels of \"bad\" cholesterol (LDL) and triglycerides in the blood, while increasing levels of \"good\" cholesterol (HDL).','application/pdf','99818','image/jpeg','9440','2012-09-22 10:59:15'),(25,'Ciprofloxacin','Ciprofloxacin','Cipro','Sanofi-Aventis','100 x Tabletes','Anthrax','500 mg','Peroral','Daily','S',1,'day',50.5550,60.9990,'Documents/Ciprofloxacin_1234567895_Ciprofloxacin.pdf','Documents/Ciprofloxacin_1234567895_Ciprofloxacin.jpg','','1234567895','Ciprofloxacin is used to treat different types of bacterial infections. It may also be used to prevent or slow anthrax after exposure.','application/pdf','180998','image/jpeg','55353','2012-09-22 11:02:21'),(26,'Diovan','Hydrochlorothiazide','Diovan HCT','Novartis','10 x Tabletes','Body','50 mg','Injections','Montly','XXL',1,'month',100.5550,120.9990,'Documents/Diovan_1234567896_Diovan.pdf','Documents/Diovan_1234567896_Diovan.jpg','','1234567896','The combination of hydrochlorothiazide and valsartan is used to treat high blood pressure (hypertension).','application/pdf','351910','image/jpeg','12499','2012-09-22 11:07:00'),(27,'Dilaudid','Hydromorphone','Exalgo','Novartis','10 x Ampules','Body','5 mg','Peroral','Biweekly','XL',10,'day',20.5550,25.9990,'Documents/Dilaudid_1234567897_Dilaudid.pdf','Documents/Dilaudid_1234567897_Dilaudid.jpg','','1234567897','Dilaudid is used to treat moderate to severe pain.','application/pdf','170244','image/jpeg','35308','2012-09-22 11:13:57'),(28,'Effexor','Venlafaxine','Effexor XR','Hoffmann–La Roche','30 x Tabletes','tete','30 mg','Eye Drops','Weekly','M',10,'day',20.5550,25.9990,'Documents/Effexor_1234567898_Effexor.pdf','Documents/Effexor_1234567898_Effexor.jpg','','1234567898','Effexor is used to treat major depressive disorder, anxiety, and panic disorder.','application/pdf','91013','image/jpeg','9540','2012-09-22 11:18:14'),(29,'Enbrel','Etanercept','Enbrel','Wyeth','10 x Tabletes','Immune','40 mg','Ear Drops','Daily','S',6,'day',50.5550,60.9990,'Documents/Enbrel_1234567899_Enbrel.pdf','Documents/Enbrel_1234567899_Enbrel.jpg','','1234567899','In people with autoimmune disorders, the immune system mistakes the body\'s own cells for invaders and attacks them.\r\n\r\nEnbrel is used to treat the symptoms of rheumatoid arthritis, psoriatic arthritis, or ankylosing spondylitis, and to prevent joint damage caused by these conditions. Enbrel is also used to treat plaque psoriasis in adults and polyarticular juvenile idiopathic arthritis in children who are at least 2 years old.','application/pdf','142021','image/jpeg','7591','2012-09-22 11:21:04'),(30,'Femara','Letrozole','Femara','Novartis','10 x Tabletes','Cancer','2.5 mg','Injections','Daily','S',1,'week',100.5550,100.9990,'Documents/Femara_2234567899_Femara.pdf','Documents/Femara_2234567899_Femara.jpg','','2234567899','Lowers estrogen levels in postmenopausal women, which may slow the growth of certain types of breast tumors that need estrogen to grow in the body.','application/pdf','413150','image/jpeg','38168','2012-09-22 11:32:49'),(31,'Flomax','Tamsulosin','Flomax','Novartis','10 x Tabletes','Urination','50 mg','Rectal Suppositories','Montly','L',1,'month',100.5550,150.9990,'Documents/Flomax_3234567899_Flomax.pdf','Documents/Flomax_3234567899_Flomax.jpg','','3234567899','Flomax relaxes the muscles in the prostate and bladder neck, making it easier to urinate.\r\n \r\nFlomax is used to improve urination in men with benign prostatic hyperplasia (enlarged prostate).','application/pdf','328587','image/jpeg','4737','2012-09-22 11:35:55'),(32,'Gardasil','HPV','Gardasil','Wyeth','5 x Tabletes','Cancer','5 mg','Injections','Montly','M',1,'month',100.5550,150.9990,'Documents/Gardasil_4234567899_Gardasil.pdf','Documents/Gardasil_4234567899_Gardasil.jpg','','4234567899','prevent genital warts and cervical, vaginal, anal cancers caused by human papillomavirus types 6, 11, 16, and 18 in girls and young women ages 9 through 26.','application/pdf','679228','image/jpeg','9562','2012-09-22 12:44:52'),(33,'Geodon','Ziprasidone','Geodon','AstraZeneca','100 x Tabletes','Antipsychotic','50 mg','Nose Drops','Daily','L',1,'day',10.5500,20.5500,'Documents/Geodon_5234567899_Geodo.pdf','Documents/Geodon_5234567899_Geodo.jpg','','5234567899','Geodon is used to treat schizophrenia and the manic symptoms of bipolar disorder (manic depression) in adults and children who are at least 10 years old.','application/pdf','477696','image/jpeg','62100','2012-09-22 12:48:57'),(34,'Nexium','Esomeprazole','Nexium','AstraZeneca','10 x Tabletes','Gastro','40 mg','Rectal Suppositories','Weekly','M',5,'day',10.5590,15.5590,'Documents/Nexium_6234567899_Nexium.pdf','Documents/Nexium_6234567899_Nexium.jpg','','6234567899','Nexium is used to treat symptoms of gastroesophageal reflux disease (GERD) and other conditions involving excessive stomach acid such as Zollinger-Ellison syndrome.','application/pdf','501341','image/jpeg','19635','2012-09-22 12:52:23');
